function Login() {
  return (
    <section>
      <div className="container">
        <div className="logo-container">
            <img src="https://www.entreprenerd.cl/wp-content/uploads/2022/03/Logo-Xepelin-JPG.jpg" alt="Xepelin Logo" width="180px" height="80px" className="image-logo" ></img>
        </div>
        <div className="login-container">
            <form>
                <input type="text"></input>
                <input type="password"></input>
                <button>Iniciar sesion</button>
            </form>
        </div>    
      </div>
    </section>
  );
}

export default Login;
